const title = (props)=>(
    <div className="row">
        <div className="col">
        <img src="https://homepages.cae.wisc.edu/~ece533/images/tulips.png" alt="Avatar" />
        </div>
        <div className="col">
        <h6>{props.username}</h6>
        <style jsx>
        {`          
            img{
                vertical-align: middle;
                width: 40px;
                height: 40px;
                border-radius: 50%;
                width: 40px;
            }
        `}
        </style>
        </div>
    </div>
);

export default title;
